import { useState } from "react";
import { PatternFormat } from 'react-number-format';

export default function Login() {

	const [phoneNumber, setPhoneNumber] = useState();

	const handlePhoneNumber = (e) => {
		const inputPhoneNumber = e.target.value.replace(/\D/g, ''); // Remove non-digit characters
		let formattedPhoneNumber = '+998';

		if (inputPhoneNumber.length >= 2) {
			formattedPhoneNumber += ` (${inputPhoneNumber.slice(0, 2)})`;

			if (inputPhoneNumber.length >= 5) {
			  formattedPhoneNumber += ` - ${inputPhoneNumber.slice(2, 5)}`;

			  if (inputPhoneNumber.length >= 8) {
				formattedPhoneNumber += ` - ${inputPhoneNumber.slice(5, 7)}`;

				if (inputPhoneNumber.length >= 10) {
				  formattedPhoneNumber += ` - ${inputPhoneNumber.slice(7, 9)}`;
				}
			  }
			}
		  }

		setPhoneNumber(formattedPhoneNumber);
	};

    return (
        <div className="container-fluid">
			<h1>Salom</h1>
			<PatternFormat format="+998 (##) ###-##-##" value="123456789" valueIsNumericString={true} />

		<div className="row">
			<div className="col-lg-6 col-md-6 d-none d-md-block infinity-image-container"></div>

			<div className="col-lg-6 col-md-6 infinity-form-container">
				<div className="col-lg-9 col-md-12 col-sm-8 col-xs-12 infinity-form">
					<div className="text-center mb-3 mt-5">
						{/* <img src="logo.png" width="150px"> */}
					</div>
					<div className="text-center mb-4">
		        <h4>Tizimga kirish</h4>
		      </div>
					<form className="px-3">
						<div className="form-input">
							<span><i className="fa fa-envelope"></i></span>
							<input type="text"
								value={phoneNumber}
      							onChange={handlePhoneNumber} 
								name="" 
								placeholder="Email Address" 
								tabindex="10" required />
						</div>
						<div className="form-input">
							<span><i className="fa fa-lock"></i></span>
							<input type="password" name="" placeholder="Parol" required />
						</div>
						<div className="row mb-3">
		  	      <div className="col-auto d-flex align-items-center">
				        <div className="custom-control custom-checkbox">
				          <input type="checkbox" className="custom-control-input" id="cb1" />
				         	<label className="custom-control-label" for="cb1">Remember me</label>
				        </div>
				      </div>
				    </div>

				    <div className="mb-3"> 
							<button type="submit" className="btn btn-block">Login</button>
						</div>
						<div className="text-right">
			        <a href="reset.html" className="forget-link">Forgot password?</a>
			      </div>

						<div className="text-center mb-2">
		         	<div className="text-center mb-3" style={{color: '#777'}}>or login with</div>

		         	<a href="" className="btn btn-social btn-facebook">facebook</a>

							<a href="" className="btn btn-social btn-google">google</a>

							<a href="" className="btn btn-social btn-twitter">twitter</a>
						</div>

						<div className="text-center mb-5" style={{color: '#777'}}>Don't have an account? 
							<a className="register-link" href="register.html">Register here</a>
	        	</div>
					</form>
				</div>
			</div>
		</div>
	</div>
    );
}
